INSERT INTO `filme` VALUES (656,3.4,'A Chegada',10,'Quando seres interplanetários deixam marcas na Terra, a Dra. Louise Banks (Amy Adams), uma linguista especialista no assunto, é procurada por militares para traduzir os sinais e desvendar se os alienígenas representam uma ameaça ou não. No entanto, a resposta para todas as perguntas e mistérios pode ameaçar a vida de Louise e a existência de toda a humanidade.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/wdMDRMI8UvacB9iyUqiOaCvICj6.jpg'),(657,1.8,'A Última Ressaca do Ano',16,'Com a morte recente do pai, os irmãos Clay (T.J. Miller) e Carol Vanston (Jennifer Aniston) disputam o controle da empresa de tecnologia por ele criada. Presidente da companhia, ele é ameaçado por ela, CEO, que planeja inclusive demitir todos os funcionários. Visando impressionar um novo cliente que pode representar sua garantia no poder, Clay pede que seu braço direito, Josh (Jason Bateman), organize uma espetacular festa de Natal.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/cW85VlHPm3pz0anupAXHL9eTh5b.jpg'),(658,3.5,'Animais Fantásticos e Onde Habitam',12,'Baseado no livro homônimo de J.K. Rowling. O excêntrico magizoologista Newt Scamander (Eddie Redmayne) chega à cidade de Nova York com sua maleta, um objeto mágico onde ele carrega uma coleção de fantásticos animais do mundo da magia que coletou durante as suas viagens. Em meio a comunidade bruxa norte-americana que teme muito mais a exposição aos trouxas do que os ingleses, Newt precisará usar suas habilidades e conhecimentos para capturar uma variedade de criaturas que acabam saindo da sua maleta.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/pGjKVOxF8PirC2sXQLXSLh2nD0h.jpg'),(659,2.1,'Anjos da Noite: Guerras de Sangue',14,'O quinto filme da franquia Anjos da Noite vai acompanhar uma nova geração de vampiros e lobisomens disposta a lutar até o fim a histórica batalha interracial de seres sobrenaturais.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/i8CTOmMkw8dYrzkDmYNzcleUZwI.jpg'),(660,3,'As Aventuras de Robinson Crusoé',0,'Terça-feira, um extrovertido papagaio vive com seus amigos animais em uma pequena ilha, um verdadeiro paraíso. Entretanto, ele não consegue parar de sonhar em descobrir o mundo. Após uma violenta tempestade, Terça-feira e seus amigos encontram uma estranha criatura na praia: Robinson Crusoé. Ele imediatamente enxerga Crusoé como seu passaporte para realizar seu sonho. Por outro lado, Crusoé logo descobre que a chave para sua sobrevivência na ilha é através da ajuda de Terça-feira e os outros animais.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/syM1tYvLcPZpurQ2CFFyUbHpI36.jpg'),(661,0,'Elis',14,'O filme aborda a história de Elis Regina desde sua chegada ao Rio com 19 anos até sua morte trágica e precoce. Apesar de todas as dificuldades, o sucesso vem fulminante e a vida de Elis Regina ganha projeção nacional e internacional. A jovem de origem humilde se torna uma das maiores artistas da música e é considerada até hoje a maior cantora do Brasil.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/wOLuaWMkxntA9LY374cKcQEj2PW.jpg'),(663,0,'Galinha Pintadinha Mini na Telona',0,'',NULL,NULL,'http://www2.trt8.jus.br/leilao/imagens/img_indisponivel.jpg'),(664,2.3,'Jack Reacher: Sem Retorno',14,'Jack Reacher (Tom Cruise) retorna à base militar onde serviu na Virgínia, onde pretende levar uma comandante local para jantar. Só que, logo ao chegar, descobre que ela foi sequestrada. Não demora muito para que ele assuma a responsabilidade de salvá-la.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/cl8edcDWN0WFZhILvzXvZC8RV9c.jpg'),(665,0,'Masha e o Urso',0,'Masha é uma criança cheia de energia que vive em uma casa próxima a estação de trem na floresta. Doce e amigável com todos que ela conhece, esta menina enérgica não consegue manter-se longe de problemas. Urso é uma figura calorosa e companheira, que faz o seu melhor para guiar sua amiga e impedi-lá de se machucar, muitas vezes terminando a vítima não intencional de suas desventuras. Embora ele goste de seu tempo sozinho, sente falta daqueles momentos em que Masha não está por perto. Juntamente com um grupo de animais amigáveis que fizeram da floresta a sua casa, Masha e o Urso divertem adultos e crianças, ensinando aos adultos sobre a criatividade, lealdade e amizade verdadeira.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/uBNQB6NaqUcCCLhZS9bvPeLqwgP.jpg'),(666,0,'O Último Virgem',14,'Dudu (Guilherme Prates) é um tímido garoto que frequenta o último ano do Ensino Médio, não tem muita prática com garotas e ainda é virgem. Por isso, seus amigos Escova (Lipy Adler), Borges (Éverlley Santos) e Gonzo (Christian Villegas) resolvem ajudá-lo a ter sua primeira relação sexual, das formas mais loucas possíveis, depois que Dudu recebe um estranho convite da bela Débora (Fiorella Mattheis), a professora mais desejada do colégio.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/hmFQfRLQOdCzG1vQAQVacQHLRjD.jpg'),(667,0,'O Vendedor de Sonhos',12,'Uma adaptação do best-seller de mesmo nome, do psicoterapeuta e escritor Augusto Cury. Júlio César (Dan Stulbach) é um psicólogo decepcionado com a vida em geral e tenta o suicídio. Ele então é impedido de cometer o ato final por intermédio de um mendigo, o &quot;Mestre&quot; (César Troncoso). Surge aí uma amizade peculiar entre os dois e a dupla logo passa a tentar salvar pessoas apresentando um novo caminho para se viver.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/97uSDWOLAByUEfNBQ6b4MQd9yIL.jpg'),(668,0,'Tamo Junto',14,'Felipe não faz ideia, mas a vida de solteiro não é tão fácil quanto parece. Agora ele vai ter que driblar as ciladas do mundo adulto junto com o seu melhor amigo de infância, e tentar se dar bem no final da história. Com Leandro Soares​, Sophie Charlotte​, Fernanda Souza​, Fábio Porchat​, Matheus Souza​ e grande elenco.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/sO1NtBA8agywjpFjBJKSX9Qrdi9.jpg'),(669,3,'Rogue One: Uma História Star Wars',0,'A trama se passa antes do Episódio IV: Uma Nova Esperança e trata da tentativa de roubo dos planos da Estrela da Morte. Um grupo de pilotos enfrenta a missão de suas vidas ao tentar buscar o projeto da arma espacial.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/cuBJ8EjhNGcQYYkHoGk82mxVWkc.jpg'),(670,2,'Sing - Quem Canta Seus Males Espanta',0,'Um empolgado coala chamado Buster decide criar uma competição de canto para aumentar os rendimentos de seu antigo teatro. A disputa movimenta o mundo animal e promove a revelação de diversos talentos da cidade, todos de olho nos 15 minutos de fama e US$ 100 mil dólares de prêmio.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/fv2yWvNFxm5XhKOY8Jw0ewHlUGK.jpg'),(671,0,'Assassin\'s Creed',0,'Por meio de uma tecnologia revolucionária que destrava suas memórias genéticas, Callum Lynch (Michael Fassbender) experimenta as aventuras de seu ancestral, Aguilar, na Espanha do século XV. Callum descobre que é descendente de uma misteriosa sociedade secreta, os Assassinos, e acumula conhecimentos e habilidades incríveis para enfrentar a organização opressiva e poderosa dos Templários nos dias de hoje.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/jdLEgr7msInM2ZzrKlPtQyeSG43.jpg'),(672,3.5,'O Homem Que Viu o Infinito',12,'Uma história real. Srinivasa Ramanujan teve uma infância pobre e cresceu sem ter acesso à educação básica na Índia. Em 1913, ele decidiu escrever uma carta para o matemático inglês G.H. Hardy, que reconheceu sua inteligência e o ajudou a testar suas teorias pioneiras.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/hPGC26Bkk86vBnW4TnMPp33Gm1j.jpg'),(673,3.8,'Para Sempre Alice',12,'A Dra. Alice Howland (Julianne Moore) é uma renomada professora de linguistica. Aos poucos, ela começa a esquecer certas palavras e se perder pelas ruas de Manhattan. Ela é diagnosticada com Alzheimer. A doença coloca em prova a a força de sua família. Enquanto a relação de Alice com o marido, John (Alec Baldwinse), fragiliza, ela e a filha caçula, Lydia (Kristen Stewart), se aproximam.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/yGiV8T4TF1YfwVe0nRVpqtSx1dc.jpg'),(674,0,'Elle',14,'',NULL,NULL,'http://www2.trt8.jus.br/leilao/imagens/img_indisponivel.jpg'),(675,2,'Fallen',12,'Após ser responsabilizada pela misteriosa morte do namorado, Lucinda Price (Addison Timlin) é mandada para o reformatório Sword &amp;amp; Cross, onde se aproxima de Daniel Grigori (Jeremy Irvine), sem saber que ele é um anjo apaixonado por ela há milênios. Ao mesmo tempo, Lucinda não consegue se afastar de Cam Briel (Harrison Gilbertson), que também é um anjo e há tempos luta pelo seu amor. Por viver isolada do mundo exterior e assombrada por estranhas visões, ela começa a desvendar aos poucos os segredos de seu passado e descobre a verdadeira identidade dos anjos caídos, bem como o amor que nutriram por ela ao longo de séculos. Lucinda deve, então, fazer sua escolha.',NULL,NULL,'https://image.tmdb.org/t/p/w300_and_h450_bestv2/e0mUncksrRaWpdBcxt0VExmAIgh.jpg');
